import styled from 'styled-components';

export const NavContainer = styled.nav`
  display: flex;
  justify-content: right;
  padding: 0;

  ul {
    display: flex;
    gap: 1rem;
    list-style-type: none;

  }
`;

export const LogoContainer = styled.div`
  display: flex;
  align-items: left;
  justify-content: left;
`;
